In 1982 probeert een jonge immigrant zich staande te houden in New York. Samen met zijn jeugdvriend Eddie Argitakos (Liam Hemsworth) besluit hij wat op dat moment de grootste overval uit de Amerikaanse historie is te plegen. Ze stelen meer dan 15 miljoen dollar uit een geldtransportwagen van het bedrijf waar hij werkt als bewaker. Een rechercheur van de New Yorkse politie (Dwayne Johnson) zit hen echter op de hielen.



